import { Injectable } from '@angular/core'

@Injectable({
  providedIn: 'root',
})
export class ServiceService {
  message: string | undefined
  constructor() {}
  setMessage(data) {
    this.message = data
  }
  getMessage() {
    return this.message
  }
}
